import { combineReducers } from "redux";

const initstate = {
  projects: [
    { id: 1, title: "kjfsdljfwljf" },
    { id: 2, title: "lkqejfoijflk" },
    { id: 3, title: "kjfsdljfwljf" }
  ]
};

const Reducer = (state = initstate, action) => {
  console.log(state);
  switch (action.type) {
    default:
      return state;
  }
};

const rootReducer = combineReducers({
  reducer: Reducer
});

export default rootReducer;
